import React, { FunctionComponent } from 'react';
import Parallax from '../Parallax/Parallax';

import { AboutContainer, Row, InsideParallax, TitleContainer, AboutMe, Gear } from './about.style';
import { Title } from '../regular/text';
import { TextContainer } from '../regular/container';

const About: FunctionComponent = () => {
    return (
        <AboutContainer>
            <Parallax img="images/parallax-2.jpg" speed={0.5}>
                <InsideParallax>
                    <Row>
                        <TitleContainer>
                            <Title color="black">About me and my gear</Title>
                        </TitleContainer>
                    </Row>
                    <Row>  
                        <AboutMe>
                            <TextContainer>

                            </TextContainer>
                        </AboutMe>
                        <Gear>
                            <TextContainer>
                                
                                </TextContainer>
                        </Gear>
                    </Row>
                </InsideParallax>
            </Parallax>
        </AboutContainer>
    )
}

export default About;
